import React from "react";

const incomeData = [
    {id: 1, name: 'Microsoft', amount: 5000, time: '11-05-2022', discription: 'Project lorem ipsum'},
    {id: 2, name: 'Google', amount: 2000, time: '20-05-2022', discription: 'Project lorem ipsum'},
    {id: 3, name: 'Apple', amount: 3000, time: '01-06-2022', discription: 'Project lorem ipsum'},
    {id: 4, name: 'Vega IT', amount: 1000, time: '04-08-2022', discription: 'Project lorem ipsum'},
    {id: 5, name: 'Dell', amount: 4000, time: '21-09-2022', discription: 'Project lorem ipsum'}
]

const expenseData= [
    {id: 1, name: 'Rent', amount: 5000, time: '12-05-2022', discription: 'Rent paymant to landlord'},
    {id: 2, name: 'Taxes', amount: 2000, time: '25-05-2022', discription: 'Income Tax'},
    {id: 3, name: 'Salaries', amount: 5000, time: '07-06-2022', discription: 'Employees Salary for the mounth of May'},
    {id: 4, name: 'Marketing', amount: 1000, time: '10-08-2022', discription: 'Company Marketing'},
    {id: 5, name: 'Banca Intesa', amount: 4000, time: '28-09-2022', discription: 'Bank Loan Monthly Interest'}
]

const Table = () => {
    return (
        <>

            <table>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>Name</th>
                        <th>Amount</th>
                        <th>Time</th>
                        <th>Discription</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        expenseData.map((value, key) => {
                            return (
                                <tr key={key}>
                                    <td>{value.type}</td>
                                    <td>{value.id}</td>
                                    <td>{value.name}</td>
                                    <td>{value.amount}</td>
                                    <td>{value.time}</td>
                                    <td>{value.discription}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        </>
    );
}

export default Table;
